import React from 'react';
import { Button } from "antd";

export const Columns = (setPricing) => [
  {
    title: '#',
    dataIndex: 'rowKey',
    key: 'rowKey',
  },
  {
    title: 'Nombre',
    dataIndex: 'name',
    key: 'name'
  },
  {
    title: 'Accion',
    render: (d, text) => <span><Button type="danger" onClick={() => setPricing([])} icon="close-circle" /></span>
  }
];


export default Columns;
